import React from 'react'
import styled from "styled-components"

const Card = styled.div`
    height:10vh;
    width:80%;
    background-color: #009688;  
    margin: 10px auto;
    filter:drop-shadow(5px 5px 5px black);
`
export default function OldPlaylistCard() {
    return (
        <Card>
            Chapter 005
        </Card>
    )
}
